import {Route,Routes} from 'react-router-dom'
import Dashboard from './components/Dashboard';
import Home from './components/Home';
import Login from './components/Login';
import Logout from './components/Logout';
import Register from './components/Register';
import ProtectedRoutes from './ProtectedRoutes';


function App() {
  return (
    <Routes>
      <Route path='/' element={<Home/>}></Route>
      <ProtectedRoutes path='/Login' element={<Login/>} auth={true}></ProtectedRoutes>
      <ProtectedRoutes path='/Register' element={<Register/>} auth={true}></ProtectedRoutes>
      <ProtectedRoutes path='/Dashboard' element={<Dashboard/>} auth={true}></ProtectedRoutes>
      <ProtectedRoutes path='/Logout' element={<Logout/>} auth={true}></ProtectedRoutes>
    </Routes>
  );
}

export default App;
